import { Grid, Avatar, Input, Button } from "@mui/material";
import { deepOrange, deepPurple } from "@mui/material/colors";

const AddTwist = () => {
  return (
    <Grid container direction="column" justifyContent="flex-start" xs={6}>
      <Grid container item columnSpacing={2}>
        <Grid item>
          <Avatar alt="userAvatar" sx={{ bgcolor: deepOrange[500] }}>
            HC
          </Avatar>
        </Grid>
        <Grid item xs={6}>
          <Input
            type="text"
            placeholder="Azul"
            disableUnderline
            multiline
            maxRows={4}
            fullWidth
          ></Input>
        </Grid>
      </Grid>
      <Grid item alignSelf="end">
        <Button
          variant="contained"
          sx={{ bgcolor: "#1D9BF0", borderRadius: "1000px", fontWeight: 900 }}
          size="large"
        >
          Twister
        </Button>
      </Grid>
    </Grid>
  );
};

export default AddTwist;
